import React from 'react';

const Profile: React.FC = () => {
  const token = localStorage.getItem('token');

  return (
    <div>
      <h1>Profile Page</h1>
      {token ? <p>Logged in with token: {token}</p> : <p>Please log in to view this page.</p>}
    </div>
  );
};

export default Profile;
